'%{
\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cToday medicine is just another profession, and doctors have become like everybody else: insecure, discontented, and anxious about the future. In surveys, a majority of doctors express diminished enthusiasm for medicine and say they would discourage a friend or family member from entering the profession. In a 2008 survey of twelve thousand physicians, only 6 percent described their morale as positive. Eighty-four percent said their incomes were constant or decreasing. The majority said they did not have enough time to spend with patients because of paperwork, and nearly half said they planned to reduce the number of patients they would see in the next three years or stop practicing altogether. American doctors are suffering from a collective malaise. We strove, made sacrifices, and for what? For many, the job has become only that—a job. C\n\nMay 29, 2017\n\u001c10\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cInsensitivity in patient-doctor interactions has become almost normal.\n\nMay 29, 2017\n\u001c20\n\u0011\n\u0011\n\n\nI: Ambition\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c“By the time patients get to me, they have already seen their internist and cardiologist. They have had their echos and caths. Still, I feel an obligation to examine them. When I listen to their hearts, I make sure to put my hand on their shoulder to convey a sense of warmth. I think it is enormously important to touch patients before I cut into them\n\nMay 29, 2017\n\u001c64\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cA big problem was a lack of health literacy—patients not knowing that they needed to eliminate salt from their diets or take their medications regularly, for example—which was due in no small part to inadequate teaching on the part of their care providers. A typical complaint from patients was that their doctors had told them they had weak hearts but never told them why. “I spent two weeks in the hospital, but no one ever talked to me about it,” one patient told me. “They never said, ‘This is what is happening. This is what you can expect.’ In fact, no one ever talked to me about it until now.\n\nMay 29, 2017\n\u001c66\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMay 29, 2017\n\u001c70\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWho hugs you, Doctor?” I laughed. “No one.” The sheer arduousness of taking care of a newborn had sapped the romantic energy at home. “Don’t look at me,” John quickly interjected. “I’ll give you a hug,” she said. Embarrassed, I shook my head. “No, that’s all right.” “No, it’s not all right. Come here. Give me a hug.” She struggled to sit up, swaying from side to side to pull up her three hundred or so pounds. Then she grabbed hold of me. “If you get fifteen hugs a day, all your problems will be solved.” “I wish it were that easy,” I said as she\n\nMay 29, 2017\n\u001c73\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001csqueezed the air out of me. “No, I’m serious,” she said. “A hug does something to your inside.” (No question about that, I thought, feeling my spleen being crushed.)\n\nMay 29, 2017\n\u001c73\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAnother doctor wrote: “The whole ‘apologize and hope it goes away’ thing is such a phony myth perpetuated by ethics types who don’t have to worry about career ruin in the lawyer gang-bang that is U.S. health care.” And another wrote: “It’s like confessing an extramarital affair to your spouse. What do you expect to accomplish?” However, studies have shown that physicians’ apologies do not necessarily increase malpractice lawsuits. In fact, they might protect against litigation. In surveys patients say they desire acknowledgment of even minor errors. For both moderate and severe mistakes, patients are significantly more likely to sue if a physician does\n\nMay 29, 2017\n\u001c83\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cnot disclose the error, a fact most doctors are unaware of. There has been a trend toward such apologies. Twenty-nine states have enacted legislation encouraging them, some even making physicians’ expressions of remorse inadmissible in court\n\nMay 29, 2017\n\u001c83\n\u0011\n\u0011"},{"ty":"ae","et":"inline","id":"i.0","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":105.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":150.9375,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":"Cover Image","i_cid":"1OF9d-B4T6YL8r6uYr38w7VC_93qCs1sHILFcMiU","i_cont":0.0,"i_opa":1.0,"eo_mt":1.5,"eo_type":0}}},{"ty":"ae","et":"inline","id":"i.1","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":24.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":18.0,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":null,"i_cid":"1RYOP0Uz0Wr7dvNHHG6LVNHOuq1Fe9squEOxjqjY","i_cont":0.0,"i_opa":1.0,"eo_mt":1.5,"eo_type":0}}},{"ty":"ae","et":"inline","id":"i.10","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":24.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":18.0,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":null,"i_cid":"1qhNCeJP_UmxOq2H36hLkIgbpEnLRbYRanGeMmCo","i_cont":0.0,"i_opa"