alse,"ts_it":true,"ts_va":"nor","ts_va_i":false,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#c5e1a5","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":3176,"ei":3189,"sm":{"ts_ff_i":false,"ts_fgc":"#757575","ts_fgc_i":false,"ts_va":"nor","ts_va_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":3190,"ei":3207,"sm":{"ts_un":true,"ts_fgc":"#1565c0","ts_un_i":false,"ts_fgc_i":false,"ts_va":"nor","ts_va_i":false}},{"ty":"as","st":"text","si":3208,"ei":3869,"sm":{"ts_ff_i":false,"ts_it":true,"ts_va":"nor","ts_va_i":false,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#ffb8a1","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":3870,"ei":3883,"sm":{"ts_ff_i":false,"ts_fgc":"#757575","ts_fgc_i":false,"ts_va":"nor","ts_va_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":3884,"ei":3901,"sm":{"ts_un":true,"ts_fgc":"#1565c0","ts_un_i":false,"ts_fgc_i":false,"ts_va":"nor","ts_va_i":false}},{"ty":"as","st":"text","si":3902,"ei":4144,"sm":{"ts_ff_i":false,"ts_it":true,"ts_va":"nor","ts_va_i":false,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#ffb8a1","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":4145,"ei":4158,"sm":{"ts_ff_i":false,"ts_fgc":"#757575","ts_fgc_i":false,"ts_va":"nor","ts_va_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":4159,"ei":4164,"sm":{"ts_un":true,"ts_fgc":"#1565c0","ts_un_i":false,"ts_fgc_i":false,"ts_va":"nor","ts_va_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="/K5M4TNzdCQmkSPHmK+N+OD0o+o"  nonce="/K5M4TNzdCQmkSPHmK+N+OD0o+o">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="/K5M4TNzdCQmkSPHmK+N+OD0o+o"  nonce="/K5M4TNzdCQmkSPHmK+N+OD0o+o">DOCS_modelChunk = [{"ty":"is","ibi":4165,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001ca lawyer for the hospital said that at some point in our careers every one of us would likely be sued, and that we could even be sued during residency. She offered some advice: document your decision-making; document when a patient refuses treatment; never admit wrongdoing; never talk to an opposing attorney; and finally, be nice to your patients. Doctors who were nice to their patients were rarely sued, even in cases of egregious malpractice.\n\nMay 29, 2017\n\u001c83\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMay 29, 2017\n\u001c85\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe story of this patient is one we encountered almost every day my first year at LIJ: a heart attack victim taken by ambulance to a community hospital that isn’t equipped to perform angioplasty. If the man had been brought to LIJ, which has cardiac catheterization available twenty-four hours a day, the damage to his heart could have been averted, adding years to his life. But it would have required a degree of coordination and oversight that many ambulance fleets in New York and across the country lack. We discussed many such cases at hospital meetings on how to shorten door-to-balloon (D2B) time, the time between hospital arrival and balloon angioplasty for patients having heart attacks. In 1971, Eugene Braunwald, a cardiologist at Harvard Medical School, proposed a radical hypothesis: “Time is muscle.” He postulated that acute myocardial infarction is a dynamic process and that cardiac injury could be reduced by expeditious intervention. Many studies since then have demonstrated that shorter D2B time is strongly associated with survival\n\nMay 31, 2017\n\u001c102\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMore important, patients don’t always require specialists. Patients often have “overlap syndromes” (we used to call it aging), which cannot be compartmentalized into individual problems and are probably best managed by a good general physician. When specialists are\n\nMay 31, 2017\n\u001c108\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001ccalled in, they are apt to view each problem through the lens of their specific organ expertise. (Perhaps the hardest thing in medicine is to do nothing, especially when you’re called for help.) Patients generally end up worse-off. I have seen it over and over again.\n\nMay 31, 2017\n\u001c108\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMay 31, 2017\n\u001c111\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001creferrals are probably unnecessary, and there is plenty of evidence that wasteful expert consultation is adding to health costs and creating redundant care. But as a full-fledged doctor I appreciate the business. It is hard not to view a referral as an overture from another physician, and it is equally hard not to return the favor. However, referrals can put you into a moral bind. Should you refer patients back to certain doctors—not necessarily the best doctors; sometimes even assholes who aren’t particularly good with their patients—just to sustain your business? It is a paradox of specialized medicine. Specialists are better paid than primary care physicians, but they are also less autonomous because unlike primary care physicians, they depend on other doctors for referrals. So there is tremendous pressure on specialists to keep referral sources happy, especially in doctor-saturated areas like Long Island.\n\nMay 31, 2017\n\u001c112\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMay 31, 2017\n\u001c117\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMy parents were supposed to fly out the following day. I felt a vague longing for them to stay. My heart ached when I remembered how Dad used to return from research conferences with a bag of airplane peanuts or a couple of Brach’s candies for his kids.\n\nJune 3, 2017\n\u001c155\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cI wasn’t sure why I was crying. In human physiology there is the concept of referred pain, in which a painful sensation is perceived to be in a different place from where the injury actually has occurred, and so it is with emotions, too. It wasn’t just about my job or financial frustrations but something else: my relationship with my father, how he was with me—or perhaps just how he was. He had been so detached while I was growing up. I had always been desperate for his approval.\n\nJune 3, 2017\n\u001c155\n\u0011\n\u0011"},{"ty":"te","id":"i.10","spi":4174},{"ty":"te","id":"i.11","spi":4655},{"ty":"te","id":"i.12","spi":4687},{"ty":"te","id":"i.13","spi":5777},{"ty":"te","id":"i.14","spi":6077},{"ty":"te","id":"i.15","spi":6379},{"ty":"te","id":"i.16","spi":6412},{"ty":"te","id":"i.17","spi":7369},{"ty":"te","id":"i.18","spi":7402},{"ty":"te","id":"i.19","spi":7690},{"ty":"as","st":"paragraph","si":4165,"ei":4165,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":4166,"ei":4166,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"tbl","si":4167,"ei":4167,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":468.0,"col_wt":0}]}},"tbls_bw":0.75,"tbls_bc":"#bdbdbd"}},{"ty":"as","st":"cell","si":4169,"ei":4169,"sm":{"cell_pb_i":false,"cell_pr_i":false,"cell_pt_i":false,"cell_pt":0.0,"cell_pb":0.0,"cell_pr":0.0,"cell_pl_i":false,"cell_pl":0.0}},{"ty":"as","st":"tbl","si":4171,"ei":4171,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":54.0,"col