oadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="/K5M4TNzdCQmkSPHmK+N+OD0o+o"  nonce="/K5M4TNzdCQmkSPHmK+N+OD0o+o">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="/K5M4TNzdCQmkSPHmK+N+OD0o+o"  nonce="/K5M4TNzdCQmkSPHmK+N+OD0o+o">DOCS_modelChunk = [{"ty":"is","ibi":8200,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cNow that we have come up with a plan, don’t rehash everything. Keep yourself busy. An idle brain is the devil’s workshop, so keep as busy as possible. And when you go to work, work! The job has to be your first priority. And move to Long Island to be closer to your job.”\n\nJune 3, 2017\n\u001c156\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cGo after exactly what you want, not what you want. For you never get anything but the things that you exactly wanted. —Alan Gregg, twentieth-century physician\n\nJune 3, 2017\n\u001c157\n\u0011\n\u0011\n\n\nII: Asperity\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c1867 the Aetna Guide to Fire Insurance introduced the concept of moral hazard into actuarial science. The publication warned that generous insurance policies could make some people careless about preventing fires. Protected in part from the consequences of their actions, those people were more likely to engage in risky behavior, like not clearing their yards of brush or leaving their houses without adequate ventilation. The guide made a revolutionary and counterintuitive point: insurance in some cases can increase risk. Moral hazard undoubtedly plays a role in health care, too. When people complain that their rising insurance premiums are funding others’ irresponsible behavior, they are complaining about moral hazard\n\nJune 3, 2017\n\u001c183\n\u0011\n\u0011\n\n\nIII: Adjustment\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMy doc-of-the-day patients were often frustrating to manage, and not just because of the volume. A big reason was their limited resources. They rarely saw a doctor regularly, and poverty and lack of health insurance or social support were constant stressors in their lives. A social worker on one of my cases told me that for most patients, domestic problems or destructive habits were entrenched. There was little that could be done for them in the hospital, and patients were often lost to follow-up after discharge. She did the best she could, but there was only so much that could be done. Though she was trained as a clinical psychologist, most of her work revolved around mundane issues like insurance forms and discharge planning\n\nJune 4, 2017\n\u001c229\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cI smiled at John’s gravity, but he was right, of course. We so often waste our borrowed time. I had seen so much death the past four years, seen so many patients come and go. A few weeks prior, when I had been in line at the hospital deli to buy an iced coffee, a woman in front of me paid for her drink, picked up a laptop computer and a sheaf of papers, and turned to me in my white coat and said, “He’s probably dead by now, my husband,” and walked out\n\nJune 4, 2017\n\u001c248\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cthe single greatest problem in medicine today is the disrespect of time. One cannot do anything in medicine well on the fly.” So, racing through patient encounters, you practice with an ever-present fear that you will miss something, hurt someone, and open yourself up to legal (not to mention moral) liability. To cope with the anxiety, you start to call in “experts” for problems that perhaps you could have handled yourself if you had had more time to think through the case. Apart from the perverse incentives of our fee-for-service system, a major driver of overconsultation is the uncertainty engendered by the hurried pace of contemporary medicine.\n\nJune 4, 2017\n\u001c253\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThere are many things doctors could do to reduce hospital readmission rates. They could ensure that discharged patients get timely follow-up appointments. (In the New England Journal study, half of all medical patients readmitted within thirty days had not visited a doctor after discharge.) They could do a better job of ensuring that patients obtained their medications and understood how to take them. When I was a fellow, one of my elderly patients bounced back to the hospital simply because she’d missed her morning dose of diuretic on the day after discharge. Though I’d given her prescriptions and gone over the dosing schedule, I hadn’t checked whether there was someone available to drive to the pharmacy to get her medications, an oversight that resulted in a $10,000 rehospitalization. Doctors could also do a better job of educating patients about which symptoms and signs presage worsening of their disease—shortness of breath and leg swelling in congestive heart failure, for example—\n\nJune 4, 2017\n\u001c256\n\u0011\n\u0011"},{"ty":"te","id":"i.20","spi":8209},{"ty":"te","id":"i.21","spi":8515},{"ty":"te","id":"i.22","spi":8723},{"ty":"te","id":"i.23","spi":9502},{"ty":"te","id":"i.24","spi":10273},{"ty":"te","id":"i.25","spi":10763},{"ty":"te","id":"i.26","spi":11453},{"ty":"as","st":"paragraph","si":8200,"ei":8200,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":8201,"ei":8201,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"tbl","si":8202,"ei":820