","si":10276,"ei":10732,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#fde096","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":10733,"ei":10746,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":10766,"ei":11422,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#c5e1a5","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":11423,"ei":11436,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":11456,"ei":12456,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#93e3ed","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":12457,"ei":12470,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="/K5M4TNzdCQmkSPHmK+N+OD0o+o"  nonce="/K5M4TNzdCQmkSPHmK+N+OD0o+o">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="/K5M4TNzdCQmkSPHmK+N+OD0o+o"  nonce="/K5M4TNzdCQmkSPHmK+N+OD0o+o">DOCS_modelChunk = [{"ty":"is","ibi":12478,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001croom. We know that patients with a clear understanding of discharge instructions are 30 percent less likely to return to the hospital. But research shows inconsistency at best in achieving these goals. After so many years in medicine, I am convinced of one thing: The vast majority of doctors aren’t bad. It is the system that makes us bad, makes us make mistakes. Most doctors—and this is certainly true of my colleagues at the hospital—are willing to stay late and work hard to provide good care. But they are struggling to do so in a system that is diseased\n\nJune 4, 2017\n\u001c256\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAs is so often the case in our health care system, doctors’ incentives do not serve broader social goals. This virtually guarantees that proposed reforms like cutting readmissions, reducing unnecessary testing, and adopting computerized medical records will fail. The agency that runs Medicare is considering giving bonuses to hospitals that lower readmissions below the average. Though I think it’s a good idea, I believe some of this money should be shared with doctors. Current law prohibits hospitals from paying doctors for reducing hospital services, even if the goal is to provide more efficient care. But such “gainsharing” will align physicians’ incentives with cost-cutting goals. Our system, structured to encourage overutilization, needs to provide some inducements to reduce the amount of health care, too\n\nJune 4, 2017\n\u001c257\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWork out what things in life you care about, the beliefs you hold near and dear, and stick to them\n\nJune 4, 2017\n\u001c263\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe past four years at LIJ had been such a turbulent time, both professionally and personally. I’d been so occupied with the heavy lifting of establishing my career that I hadn’t given much thought to my “value system” or to the kind of doctor—and I don’t mean specialist—that I wanted to be\n\nJune 4, 2017\n\u001c264\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIn surveys, most physicians—even the dissatisfied ones—say the best part of their jobs is taking care of people. I believe this is the key to coping with the stresses of contemporary medicine: identifying what is important to you, what you believe in, and what you will fight for. For me, I’ve learned, it’s the human moments, such as the house call with Hyman Gesselman. The human moments are what others—the lawyers, the bankers—envy about our profession, and no company, no agency, no entity can take those away.\n\nJune 4, 2017\n\u001c278\n\u0011\n\u0011\n\n\nAcknowledgments\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cJune 13, 2017\n\u001c299\n\u0011\n\u0011"}
}'


